<?phpfunction gs_testimonial_jquery() {	wp_enqueue_script('jquery');}add_action('init', 'gs_testimonial_jquery');function gs_testimonial_scripts() {	if (!is_admin()) {			wp_register_script('cycle-two', plugins_url('assets/js/jquery.cycle2.min.js', __FILE__),array('jquery'),'2.1.6', true);		wp_register_script('cycle-two-caro', plugins_url('assets/js/jquery.cycle2.carousel.js', __FILE__),array('jquery'),'20130528', true);		wp_enqueue_script('cycle-two');		wp_enqueue_script('cycle-two-caro');	}}add_action( 'wp_enqueue_scripts', 'gs_testimonial_scripts' ); function gs_testimonial_style() {	if (!is_admin()) {		wp_register_style('custom-style', plugins_url('assets/css/custom.css', __FILE__),'','2.0.0', false);		wp_enqueue_style('custom-style');	}}add_action( 'init', 'gs_testimonial_style' );function gs_testimonial_enqueue_admin_script( ) {	$media='all';	wp_register_style( 'gs_free_plugins_css', plugins_url('assets/css/gs_free_plugins.css', __FILE__), '', 1.5, $media );    wp_enqueue_style( 'gs_free_plugins_css' );}add_action( 'admin_enqueue_scripts', 'gs_testimonial_enqueue_admin_script' );